[mod-setting-description]
rampant-useDumbProjectiles=옵션 비활성화 시 땅벌레와 스피터의 발사체는 호밍 발사체로 설정됩니다.
rampant-useNEUnitLaunchers=NE모드[에너미]와 함께 사용시에만 NE 유닛 런처를 중형, 대형 땅벌레와 함께 사용합니다. 비활성화 시에는 땅벌레는 유닛을 스폰 하지 않고 발사체만 발사하게 됩니다. 활성화 시에는 발사체 발사 모션으로 유닛이 스폰됩니다.
rampant-attackWaveGenerationUsePollution=Include pollution amount for threshold on chunks with 바이터 산란장 that will generate a Rampant attack wave. DOES NOT affect vanilla 바이터 waves
rampant-attackWaveGenerationUsePlayerProximity=Include player pheromones amount for threshold on chunks with 바이터 산란장 that will generate a Rampant attack wave. DOES NOT affect vanilla 바이터 waves
rampant-attackWaveGenerationThresholdMax=The total score that a chunk must reach in order for an attack wave to spawn. DOES NOT affect vanilla 바이터 waves. Scaling linearly with evolution factor (starting threshold @ 0.0 evolution)
rampant-attackWaveGenerationThresholdMin=The total score that a chunk must reach in order for an attack wave to spawn. DOES NOT affect vanilla 바이터 waves. Scaling linearly with evolution factor (ending threshold @ 100.0 evolution)
rampant-attackWaveMaxSize=If you wish to change how the attack wave scales with evolution you will need to modify the config.lua in the zip file.
rampant-safeBuildings=This needs to be toggle for the safe building toggles to work. This will cause entities made safe to regenerate with the destructible flag set to false, which causes them to never be targeted or damaged again.
rampant-safeBuildings-curvedRail=Make curved rails safe from 바이터
rampant-safeBuildings-straightRail=Make straight rails safe from 바이터
rampant-safeBuildings-bigElectricPole=Make big electric poles safe from 바이터
rampant-safeBuildings-railChainSignals=Make rail chain signals safe from 바이터
rampant-safeBuildings-railSignals=Make rail signals safe from 바이터
rampant-safeBuildings-lamps=Make lamps safe from 바이터
rampant-safeBuildings-trainStops=Make train stops safe from 바이터
rampant-attackPlayerThreshold=The score that a chunk must reach for it to contribute to the attack threshold. Increasing reduces player pheromone cloud impact.
rampant-permanentNocturnal=Toggling this will cause Rampant attack waves to spawn at night. DOES NOT turn off vanilla attack groups yet. Works better with Day/Night extender mod.
rampant-aiPointsScaler=Between 0.0 and 5.0. This scales how many action points the ai gets per logic cycle to perform actions like making attack waves. 0.3 - very easy, 0.75 - easy, 1.0 - medium, 1.25+ - hard
rampant-addWallResistanceAcid=Toggling this will cause a %60 acid resistance to be added to all wall entities to reduce the damage done by 스피터 to walls back to vanilla levels.
rampant-useCustomAI=Having this enabled will completely remove the vanilla ai and change how 바이터 build, produce units, and attack.
rampant-removeBloodParticles=The blood particles that are created when 바이터 are being killed can cause UPS spikes, this removes them.
# rampant-enableBuildings=Enable buildings and technologies rampant offers
rampant-enableSwarm=This reduces the size of the unit collision_mask causing them to reduce pathing collisions and smooth out the attacks
rampant-attack-warning=Shows a message warning players that an attack wave is incoming
rampant-newEnemies=Adds news enemies that will be dispersed over the world. This increases the RAM requirements minimum 2GB to 8GB.
rampant-enemySeed=The seed that powers all of the unit generation, so change this if you want the enemy stats to change
rampant-deadZoneFrequency=The percentage of zones that start without worms or nests
rampant-newEnemyNestVariations=This number corresponds to the number of variations per tier. The higher the number the smoother the enemy power curve. Min 1, Max 20
rampant-newEnemyNestTiers=This number corresponds to number of tiers. The higher the number the smoother the enemy power curve.
rampant-newEnemyWormVariations=This number corresponds to the number of variations per tier. The higher the number the smoother the enemy power curve. Min 1, Max 20
rampant-newEnemyWormTiers=This number corresponds to number of tiers. The higher the number the smoother the enemy power curve.
rampant-newEnemyUnitVariations=This number corresponds to the number of variations per tier. The higher the number the smoother the enemy power curve. Min 1, Max 20
rampant-newEnemyUnitTiers=This number corresponds to number of tiers. The higher the number the smoother the enemy power curve.
rampant-enableBobsUnits=Adds bobs spawners, units, and 땅벌레 to the base upgrade and placement list
rampant-enableNEUnits=Adds NE spawners, units, and 땅벌레 to the base upgrade and placement list
rampant-disallowFriendlyFire=Prevents enemy 스피터 and 땅벌레 from damaging units or buildings from the same force through splash damage
rampant-tierStart=This is the starting tier level and increases linearly to the end tier for as many tiers selected. min 1, max 10
rampant-tierEnd=This is the ending tier level that is reached after increasing linearly from the start tier for as many tiers selected. min 1, max 10
rampant-forceOldProjectiles=활성화 시, 발사체는 더 이상 다른 개체에 영향을 미치지 않습니다.
rampant-disableVanillaAI=This will turn off the vanilla attack waves and the vanilla 바이터 expansion.
rampant-enableMigration=This will allow the ai to expand its worms and nests. Respects the map settings for biter expansion.

rampant-unitBiterHealthScaler=Scales by a percentage all new enemy biter health
rampant-unitBiterSpeedScaler=Scales by a percentage all new enemy biter speed
rampant-unitBiterDamageScaler=Scales by a percentage all new enemy biter damage
rampant-unitBiterRangeScaler=Scales by a percentage all new enemy biter attack range
rampant-unitSpitterHealthScaler=Scales by a percentage all new enemy spitter health
rampant-unitSpitterSpeedScaler=Scales by a percentage all new enemy spitter speed
rampant-unitSpitterDamageScaler=Scales by a percentage all new enemy spitter damage
rampant-unitSpitterRangeScaler=Scales by a percentage all new enemy spitter range
rampant-unitDroneHealthScaler=Scales by a percentage all new enemy drone health. Drones come from the factions spawner and wasp.
rampant-unitDroneSpeedScaler=Scales by a percentage all new enemy drone speed. Drones come from the factions spawner and wasp.
rampant-unitDroneDamageScaler=Scales by a percentage all new enemy drone damage. Drones come from the factions spawner and wasp.
rampant-unitDroneRangeScaler=Scales by a percentage all new enemy drone range. Drones come from the factions spawner and wasp.
rampant-unitWormHealthScaler=Scales by a percentage all new enemy worm health
rampant-unitWormDamageScaler=Scales by a percentage all new enemy worm damage
rampant-unitWormRangeScaler=Scales by a percentage all new enemy worm range
rampant-unitSpawnerHealthScaler=Scales by a percentage all new enemy nest health
rampant-unitSpawnerOwnedScaler=Scales by a percentage all new enemy nest max number of units controlled per spawner
rampant-unitSpawnerSpawnScaler=Scales by a percentage all new enemy nest number of units spawned at any one time
rampant-unitSpawnerRespawnScaler=Scales by a percentage all new enemy nest time to spawn new units


[mod-name]
Rampant=램펀트(Rampant)

[mod-description]
Rampant=지역과 페로몬을 이용한 잠재적인 능력을 사용하게 하여 바이터들의 전술을 향상시킵니다. 바이터들은 수비, 퇴각, 증원, 역습, 돌파, 집결, 인간 사냥 등과 같은 전술들을 사용하게 됩니다. 또한 설정을 통해 바이터들의 호밍 발사체도 제거 가능합니다. 모드 옵션 메뉴에서 난이도 설정이 가능합니다.\n\n번역: XMKTP(Xagros)